import styled from "styled-components";
import background from "./assets/images/toelf-ielts3.jpg"

export const Wrapper = styled.div`
    min-width:100vw;
    min-height:96vh;
    background-image: url(${background});
    background-size:25%;
    margin: 0;
    padding: 0;
    `

export const EmailStyle = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    font-size:small;
    margin: 0;

    `
